import  Component  from "./Components/ExpenseItem";
function App() {
  const expense=[
    {title:"travelling",price:225.5,date:new Date(2021,5,16)},
    {title:"car washing",price:22.5,date:new Date(2021,9,19)},
    {title:"shopping",price:2250.5,date:new Date(2021,10,6)},
    {title:"resturant",price:2200.5,date:new Date(2021,11,11)}
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <Component title={expense[0].title} price={expense[0].price} date={expense[0].date}></Component>
      <Component title={expense[1].title} price={expense[1].price} date={expense[1].date}></Component>
      <Component title={expense[2].title} price={expense[2].price} date={expense[2].date}></Component>
      <Component title={expense[3].title} price={expense[3].price} date={expense[3].date}></Component>
    </div>
  );
}

export default App;
